local r = 0
function random(x, y)
    x = x or 0
    y = y or 0
    math.randomseed(os.time() * math.random(1000, 1000000))
    r = r + tonumber(math.random(1000, 1000000))
    if x == 0 and y == 0 then math.randomseed(r) if (math.random(r) % 2) == 1 then return 1 else return 0 end
    elseif x ~= 0 and y == 0 then math.randomseed(r) return math.random(x)
    else math.randomseed(r) return math.random(x, y) end
end
function StartSnake()
	params.game_step = 1
	data.score = 0
	data.tempKey = 1
	data.frames = 0
	params.inside = 1
	cell_snake = {}
	data.speed = data.imgui.speed.max-data.imgui.speed.v[0]
	data.cells = data.imgui.cells.v[0]
	data.apples = data.imgui.apples.v[0]
	table.insert(cell_snake, {math.floor(data.cells/2 + 0.5), math.floor(data.cells/2 + 0.5)})
	local EmpC = GetEmptyCells()
	apple = {}
	while (#apple ~= data.apples and #EmpC ~= 0) do
		local rndp = math.random(1, #EmpC)
		table.insert(apple, {EmpC[rndp][1], EmpC[rndp][2]})
		table.remove(EmpC, rndp)
	end
   WinOpen[0] = true
end
local rotation_start_index
function ImMin(lhs, rhs) return imgui.ImVec2(math.min(lhs.x, rhs.x), math.min(lhs.y, rhs.y)); end
function ImMax(lhs, rhs) return imgui.ImVec2(math.max(lhs.x, rhs.x), math.max(lhs.y, rhs.y)); end
function ImRotate(v, cos_a, sin_a) return imgui.ImVec2(v.x * cos_a - v.y * sin_a, v.x * sin_a + v.y * cos_a); end
function RotateStart()
   rotation_start_index = imgui.GetWindowDrawList().VtxBuffer.Size;
end
function ImRotationCenter()
   local l, u = imgui.ImVec2(imgui.FLT_MAX, imgui.FLT_MAX), imgui.ImVec2(-imgui.FLT_MAX, -imgui.FLT_MAX); -- bounds
   local buf = imgui.GetWindowDrawList().VtxBuffer
   for i = rotation_start_index, buf.Size - 1 do
      l, u = ImMin(l, buf.Data[i].pos), ImMax(u, buf.Data[i].pos);
   end
   return imgui.ImVec2((l.x+u.x)/2, (l.y+u.y)/2); -- or use _ClipRectStack?
end
function calcImVec2(l, r) return { x = l.x - r.x, y = l.y - r.y } end
function RotateEnd(rad, center)
   if center == nil then
      center = ImRotationCenter()
   end
   local s, c = math.sin(rad), math.cos(rad);
   center = calcImVec2(ImRotate(center, s, c), center);
   local buf = imgui.GetWindowDrawList().VtxBuffer;
   for i = rotation_start_index, buf.Size - 1 do
      buf.Data[i].pos = calcImVec2(ImRotate(buf.Data[i].pos, s, c), center);
   end
end
