function GetEmptyCells()
	local EmptyCells = {}
	for i = 1, data.cells^2 do
		local x = i%data.cells == 0 and data.cells or i%data.cells
    	local y = math.ceil(i/data.cells)
    	local zanyato = false
    	for _, s in pairs(apple) do
			if getDistanceBetweenCoords2d(s[1]+0.5, s[2]+0.5, x, y) < 1 then
				zanyato = true; break;
		end end
		if not zanyato then
			for _, s in pairs(cell_snake) do
				if getDistanceBetweenCoords2d(s[1]+0.5, s[2]+0.5, x, y) < 1 then
					zanyato = true; break;
		end	end end
		if x<= data.cells and y <= data.cells and not zanyato then table.insert(EmptyCells, {x-1,y-1}) end
	end
	return EmptyCells
end
